import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { SpeedSlalomBasic } from '../Model/Interface';

const host = 'localhost:3001';


const AnalyzeSSR = () => {
  const [athletesData, setathletesData] = useState<SpeedSlalomBasic[]>([]);

  useEffect(() => {
    axios.get('http://localhost:3001/api/getSSRcords')
      .then(response => {
        setathletesData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      {athletesData.map(item => (
        <li key={item.AthleteName}>{item.AthleteName}</li>
      ))}
      <table>
        <thead>
          <tr>
            <th>Athlete Name</th>
            <th>Min</th>
            <th>Max</th>
            <th>Average</th>
          </tr>
        </thead>
        <tbody>

        </tbody>
      </table>
    </div>
  );
}

export default AnalyzeSSR;
